import React from 'react';
import '../styles/index.scss';


function RegisterPage(){

  const EmailHandleFocus = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = '';
  };

  const EmailHandleBlur = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = 'email@gmail.com';
  };
  const PasswordHandleFocus = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = '';
  };

  const PasswordHandleBlur = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = 'hasło';
  };

  return (
    <form>
      <h1>Register</h1>
      <input 
        type='email' 
        className='register-input-form' 
        placeholder="email@gmail.com" 
        onFocus={EmailHandleFocus}
        onBlur={EmailHandleBlur}
        required
      />
      <input 
        type='password' 
        className='register-input-form' 
        placeholder="hasło" 
        onFocus={PasswordHandleFocus}
        onBlur={PasswordHandleBlur}
        required
      />

    </form>
  );
}

export default RegisterPage;
